import express from 'express'
import Post from '../models/Post'

const router = express.Router();

router.get('/', (req, res) => {
    try {
        const posts =  Post.find();
        res.json(posts)
    } catch(err) {
        res.json({message: err})
    }
})

router.post('/', (req, res) => {
    const post = new Post({
        title: req.body.title,
        desc: req.body.desc
    })

    post.save()
    .then(data => {
        res.json(data)
    })
    .catch(err => {
        res.json({message: err})
    })
})

module.exports = router;

